webpackJsonp([421],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-change-the-url-of-a-remote-repository.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p>The <code>git remote set-url</code> command changes an existing remote repository URL.</p>\n<p><strong>This command takes two arguments:</strong></p>\n<ol>\n<li>\n<p>An existing remote name. For example, origin or upstream are two common choices.</p>\n</li>\n<li>\n<p>A new URL for the remote. For example, <code>https://github.com/USERNAME/OTHERREPOSITORY.git</code></p>\n</li>\n</ol>\n<p><strong>So to change the URL of a remote repository you would do something like this:</strong></p>\n<ol>\n<li>View the existing remote repository:</li>\n</ol>\n<p><code>git remote -v</code></p>\n<ol>\n<li>Change the URL of the remote repository:</li>\n</ol>\n<p><code>git remote set-url origin https://github.com/USERNAME/OTHERREPOSITORY.git</code></p>\n<ol>\n<li>And you may verify the new remote repository by doing:</li>\n</ol>\n<p><code>git remote -v</code></p>\n<p><em>For more information check out <a href="https://help.github.com/articles/changing-a-remote-s-url/">this github article.</a></em></p>',frontmatter:{title:"Change the Url of A Remote Repository",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/change-the-url-of-a-remote-repository/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/change-the-url-of-a-remote-repository/"}}}});
